@Tags(Comp301Tags.FACTORY_CLASS)
public class BridgeSceneFactory { 
	static FiveAvatars scene;
	static SceneView sceneView;
	static Tables<Avatars> avatarAndObject;
	static CustomView sceneView2;
	static KeyController bridgeController;
	static ObservableBridgeScene delegateScene;
	static DelegatingScenes sceneShowed;
	static BroadcastingClearanceManager clearanceManager;
	static PanelButton sceneButtons;


	public static FiveAvatars bridgeSceneFactoryMethod(){
	   if (scene == null) {
			 scene = new FiveChars();
	   } 
	   return scene;		
	}


	public  static AngleShapes legsFactoryMethod(double rad, double ang,double radR, double angR, int valX, int valY) {
		return new RealisticLegs(rad, ang, radR, angR, valX, valY);
//		return new ArmsAndLegs(rad, ang, radR, angR, valX, valY);
	}

	public static SceneView consoleSceneViewFactoryMethod() {
		if (sceneView == null) {
			sceneView = new ConsoleSceneView();
		}
		return sceneView;
	}
	public static ObservableHelp helperFactoryMethod() {
		return new AnObservableHelper();
	}

	public static Tables<Avatars> avatarTableFactoryMethod(){
		if (avatarAndObject == null) {
			avatarAndObject = new MapStringToObject<Avatars>();
		}
		return avatarAndObject;
	}

	public static CustomView inheritingBridgeScenePainterFactoryMethod() {
		if (sceneView2 == null) {
			sceneView2 = new BridgePaintView();
		}
		return sceneView2;
	}
	public static PanelButton bridgeSceneButtonsFactoryMethod() {
		if(sceneButtons == null) {
			sceneButtons = new Buttons();
		}
		return sceneButtons;
	}
	public static KeyController bridgeSceneControllerFactoryMethod(){
		if (bridgeController == null) {
			bridgeController = new BridgeSceneController((Component)inheritingBridgeScenePainterFactoryMethod());
		}
		return bridgeController;

	}
	public static ObservableBridgeScene observableBridgeScenePainterFactoryMethod() {
		if (delegateScene == null) {
			delegateScene = new ObservableScenePainter();
		}
		return delegateScene;
	}
	public static DelegatingScenes delegatingBridgeSceneViewFactoryMethod(){
		if (sceneShowed == null) {
			sceneShowed = new DelegatingScene();
		}
		return sceneShowed;
	}

	public static BroadcastingClearanceManager broadcastingClearanceManagerFactoryMethod() {
		if (clearanceManager == null) {
			clearanceManager = new ABroadcastingClearanceManager();
		}
		return clearanceManager;

	}


}

package AnimationMethods;

import grail.compositeFigs.Avatars;
import tags301.Comp301Tags;
import util.annotations.Tags;
import util.misc.ThreadSupport;
@Tags(Comp301Tags.ANIMATOR)
public class ABridgeSceneAnimator implements BridgeSceneAnimator {
	static final int START = 0,
					MOVE_BY = 10,
					GUARD_CLAP = 5,
					MARCH_TIME = 250;
	@Override
	public synchronized void animateAvatar(Avatars anAvatar) {
		int i = START;
    	while (i < MOVE_BY) {
    	anAvatar.moveAvatar(MOVE_BY, START);   
    	ThreadSupport.sleep(MARCH_TIME);
    	i++;
    	}
	}

	@Override
	public void animateGuard(Avatars anAvatar) {
		int i = START;
    	while (i < GUARD_CLAP) {
    		if(i%2 == 0) {	
		    	anAvatar.getArms().getRightLine().rotate(-7);
		    	anAvatar.getArms().getLeftLine().rotate(7);
		    	ThreadSupport.sleep(MARCH_TIME);
		    	i++;
    			}
    		else{
	    	anAvatar.getArms().getRightLine().rotate(7);
	    	anAvatar.getArms().getLeftLine().rotate(-7);
	    	ThreadSupport.sleep(MARCH_TIME);
	    	i++;}
    	}
	}

}

