		assert preSay();
		//if(!occupationState) {return;}
		if(!knightsTurn) {
			avatarInZone.getStringShape().setText("");
			guard.getStringShape().setText(question);
			updateSpeakTurn(true);
		}
		else {
			guard.getStringShape().setText("");
