		return condition1;

	}
	@Override
	public void failed() {
		assert preFailed();
		if (!knightsTurn){ //&& occupationState) {
			avatarInZone.moveAvatar(GORGE_X, GORGE_Y);
			newOccupation(false);
		}
		else { //&& occupationState) {
			guard.moveAvatar(GORGE_X, GORGE_Y);
		}
	}

